// @ts-nocheck
export default function getAllFormIdElements(r){try{const e="string"==typeof r?document.getElementById(r):r instanceof HTMLElement?r:null;if(!e)throw new Error("string"==typeof r?`No form found with id: ${r}`:"Invalid form parameter");return Object.fromEntries(Array.from(e.querySelectorAll("input[id], select[id], textarea[id]"),(r=>[r.id,r])))}catch(r){import("../../../errors/models/AppError.js").then((({AppError:e})=>{throw new e("Get all form ID elements error: ",{originalError:r,shouldLog:!0,userMessage:null,errorCode:"RENDER_ERROR"}).logError()})).catch((r=>console.error("Error handler failed:",r)))}}